import React from 'react';
import Help from './Help/Help'
import Stats from './Stats/Stats'
import Swiper from './Swiper/Swiper'
import Profiles from './Profiles/Profiles'
import Messenger from './Messenger/Messenger'
import YourProfile from './YourProfile/YourProfile'
import Profile from './Profile/Profile'
import {BrowserRouter, Routes, Route} from "react-router-dom";

import S from './Content.module.css'
const Content = () => 
{
  const PrInf = 
  [
    {
      id:'1',
      name:'Анна',
      about: 'Сладкая стервочка',
      interes:'Пить абсент',
      meet:'Парень 20-25 лет',
      whoFind:'Хочу принца на белом коне',
      photo:'/images/users/16 (1).png'
    },
    {
      id:'2',
      name:'Василий',
      about: 'Трудоголик молодой, красивый парень, девочка давай со мной крути педали',
      interes:'Кататься на велосипеде',
      meet:'Девушка 18-22 года',
      whoFind:'Мне интересны только спортивные девушки. Если вы не такая, попрошу не писать мне',
      photo:'/images/users/16 (2).png'
    },
    {
      id:'3',
      name:'Пётр',
      about: 'Работаю в баре, болею за Манчестер Юнайтед. Это всё, что тебе нужно знать',
      interes:'Люблю подкалывать молодых посетителей бара словами "поцелуй за счёт заведения", и, ',
      meet:'Парень 18-22 года',
      whoFind:'Если любишь футбольную тему так же, как и я, мой бар для тебя открыт',
      photo:'/images/users/16 (3).png'
    }
  ]
    return(
      <div className={S.content}>
     <Help />
    <Stats />
    
    <Routes>
    <Route exact path="/Swiper" element= {<Swiper/>}/>
    <Route exact path="/Profiles" element={<Profiles/>}/>
    <Route  exact path="/Messenger" element= {<Messenger/>}/>
    <Route  exact path="/Profile" element={<YourProfile/>}/>
    {PrInf.map((elem) => (<Route  exact path={"/Profile/" + elem.id} element={<Profile name={elem.name}
     interes={elem.interes} about={elem.about} meet={elem.meet} whoFind={elem.whoFind}
      photo={elem.photo}/>}/>))}
    
    </Routes>
   
    </div>
    
    )
}

export default Content;
